            "pairingText": "Mexican works really well with Pinot Noir, Riesling, and Sparkling rosé. Acidic white wines like riesling or low-tannin reds like pinot noir can work well with Mexican dishes. Sparkling rosé is a safe pairing too. The Beaux Freres The Beaux Freres Vineyard Pinot Noir with a 4.1 out of 5 star rating seems like a good match. It costs about 56 dollars per bottle.",
