        "instructions": "<ol><li>Peel eggplant. Place the eggplant upright on the cutting board and slice the eggplant in long thin vertical slices. Sprinkle some salt and black pepper on eggplant.</li><li>Heat one tbsp of olive oil in a pan and fry the eggplant slices lightly from both sides. Keep aside.</li><li>Now heat rest of 1 tbsp of olive oil and put onions in it. Stir-fry until translucent. Add some garlic salt, red crushed pepper, and Italian seasoning, and mix well. Take onions off heat.</li><li>Heat the marinara sauce in a pan and adjust the spices per your taste. Now layer the baking dish with 1 cup of sauce in the bottom.</li><li>Now taking one strip of pasta at a time, start layering it with 2 slices of eggplant, then onions and top it off with some cheese. Start rolling pasta starting from one end and go till end. Put it seam side down in the baking dish. Repeat this process until all the pasta sheets are finished.</li><li>Cover the pasta completely with the rest of the sauce. Sprinkle rest 1 cup of the cheese on top of it.</li><li>Bake at 400 degree F in a pre-heated oven for about 25 minutes.</li><li>Let cool down for 5-7 min and serve warm with ur favorite pasta or soup.</li></ol>",
