        "instructions": "<ol><li>The dough</li><li>The yolk is first beaten until fluffy in a food processor with the sugar.</li><li>At the same time heated in a small saucepan the milk with the butter, and added something cool to the beaten egg until fluffy.</li><li>Again, continue to stir thoroughly.</li><li>Preheat the oven to 180  C preheat.</li><li>Now the flour with the Backpuler mix and add the masses and stir everything into a homogenous dough.</li><li>A springform pan with butter and flour dusting.</li><li>Divide the dough evenly and place on middle rack in oven.</li><li>The dough is baked for about 20 minutes and then taken out to cool.</li><li>The berries</li><li>Mixed Berries 50 g and remove the oil in a large pot and puree with a mixer.</li><li>Season with the sugar to the sauce.</li><li>Soak gelatin in cold water and dissolve in the pulp.</li><li>The rest of the fruit and carefully add the mix. The acid content according to taste again with the sugar.</li><li>Now the berries in the center of the dough cause.</li><li>The meringue</li><li>The protein of 3 eggs with the salt and sugar until creamy in a food processor.</li><li>Now add the cornstarch and beat the egg whites until stiff at the highest level.</li><li>The meringue filling now in a pastry bag with a spout at the option and pipe the meringue THEREBY request.</li><li>Preheat the oven to 220  F. and bake on middle shelf of this for about 15 minutes.</li><li>Remove and cool.</li></ol>",
