        "instructions": "<ol><li>Rinse and dry the zucchini and trim the ends, then cut them into halves lengthwise. Scoop out pulp with a teaspoon and chop finely. Peel and dice the onion. Sprinkle the zucchini halves with salt. Preheat the oven to 200C/400F.</li><li>In a mixing bowl, combine together the chopped zucchini, diced onion, ground meat, egg and bread crumbs. Season the mixture with salt and pepper. Fill the zucchini shells with the ground meat mixture.</li><li>Place the filled zucchini halves into a baking pan. Cut the skinned tomatoes into small dices and scatter in between the zucchini halves. Pour in the vegetable stock. Bake for 25 minutes.</li><li>Mix the flour and fresh cream in a small pot. Cook the mixture over the low heat until it simmers. Remove and season with salt and pepper. Fold in the parsley and spring onion.</li><li>Remove the zucchini from the oven and pour the cream mixture over. Sprinkle the top with the Emmentaler cheese. Return it to the oven and bake for 10 more minutes until the cheese is melted.</li></ol>",
