            "pairingText": "Gruener Veltliner, Riesling, and Sparkling rosé are great choices for Curry. The best wine for Indian food will depending on the dish, of course, but these picks can be served chilled and have some sweetness to complement the spiciness and complex flavors of a wide variety of traditional dishes. One wine you could try is Laurenz V Singing Gruner Veltliner. It has 4.4 out of 5 stars and a bottle costs about 16 dollars.",
