        "instructions": "<ol><li>In a large zippy bag place the flour, salt &amp; pepper, mix to combine. Add the ribs in batches and shake to coat. In a large frying pan melt the butter and brown the ribs on all sides, transfer the browned ribs to the bottom of a 5 qt crock pot. In the same frying pan combine the remaining items and bring to a boil, pour over the ribs. Cover and cook on low for 10-12 hours or until meat is tender and falling apart. Serve hot over mashed taters then ladle some of the sauce over top.</li></ol>",
