        "instructions": "<p>Wash the Chicken and set aside.Blend all the Ingredients together and pour as needed on the chicken. Rub it into the chicken and allow to marinate for about 3-5 hours.If you have a grill, heat up the grill and and place chicken on to cook. If you don’t and you are using an oven, set the oven to grill/broil at first and let the chicken brown on both sides then reset the oven to bake at 370 F and bake the chicken till cooked.If there is left over sauce from the blend, heat it up with a little water and serve with the peri peri chicken. Savoury RiceIngredients2 cups of Rice1/2 bulb of Onion1/4 pound of Cabbage1 cup of chopped carrots1 egg1 cup of melted butterChicken Seasoning1 teaspoon of currya pinch of thyme Wash and Parboil the Rice for 10 minutes.Heat the butter in a pot and pour in the chopped onions, carrots and cabbage and stir in.Break the egg into the veggie mix and stir in. Add your seasoning and pour in the parboiled rice. Pour in 1 cup of water and cook on medium heat till the rice is soft. Stir and serve with the chicken.</p>",
